import React from "react";
import Head from "next/head";

import AppLayout from "../components/AppLayout";

function Profile() {
  return (
    <>
      <Head>
        <meta charSet="utf-8" />
        <title>내프로필 NodeBird</title>
      </Head>
      <AppLayout>
        <div>Profile</div>
      </AppLayout>
    </>
  );
}

export default Profile;
